        (1, 'Maillot MC été Classique', '<p><strong>ZIP INT&Eacute;GRAL</strong><br />\r\nCe maillot en tissu Coolmax et manches raglan, est le produit pl&eacute;biscit&eacute; par nos clubs. Les panneaux lat&eacute;raux en &laquo;TIME OUT&raquo; &eacute;vacuant instantan&eacute;ment l&rsquo;humidit&eacute; s&egrave;che tr&egrave;s vite et permet &agrave; l&rsquo;air de circuler pour maintenir le corps &agrave; la bonne temp&eacute;rature. Sa coupe ergonomique est renforc&eacute;e par une bande &eacute;lastique silicon&eacute;e &agrave; la taille, ainsi le maillot reste parfaitement en place quelle que soit la position sur le v&eacute;lo. Un zip s&eacute;curit invisible qui respectera votre design et/ou marquage sponsor permet de bloquer le curseur &agrave; la hauteur d&eacute;sir&eacute;e. Les 3 poches renforc&eacute;es en double couture assurent un bon maintien de votre ravitaillement. 1 poche zipp&eacute;e arri&egrave;re</p>', '1801-PRO-C-615608ef1d375.png', 35, 0, 'Réf. 1801 A'),
        (2, 'Maillot MC été Pro (ajusté)', '<p><strong>PRO GORA</strong><br />\r\nCe maillot Pro aux performances a&eacute;rodynamiques &eacute;lev&eacute;es, con&ccedil;u pour rouler dans les conditions les plus chaudes et les plus humides. Le tissu &eacute;vacuant instantan&eacute;ment l&rsquo;humidit&eacute; s&egrave;che tr&egrave;s vite et permet &agrave; l&rsquo;air de circuler pour maintenir le corps &agrave; la bonne temp&eacute;rature. Son col ouvert d&eacute;gage le cou pour vous permettre de rester &agrave; l&rsquo;aise et de respirer. Les manches en Lycra &ldquo;Fan&rdquo; contribuent &agrave; la ventilation et au bien &ecirc;tre du cycliste. Une bande de maintien remplace l&rsquo;&eacute;lastique au niveau de l&rsquo;abdomen pour &eacute;viter toute compression. Un zip s&eacute;curit invisible qui respectera votre design et/ou marquage sponsor permet de bloquer le curseur &agrave; la hauteur d&eacute;sir&eacute;e. Les 2 poches renforc&eacute;es en double couture assurent un bon maintien de votre ravitaillement. Une poche &eacute;cologique sur le cot&eacute; droit sera tr&egrave;s utile lors de vos sorties et courses. &nbsp;1 poche zipp&eacute;e arri&egrave;re</p>', '1801-PRO-C-61589e882cb4e.png', 42, 0, 'Réf. 1801 PRO C'),
        (3, 'Maillot VTT ML Coupe ample', '<p>MAILLOTS LONGUES MANCHES BMX - FREE RIDE - VTT DESCENTE<br />\r\nQuelle que soit la discipline BMX (Race, Dirt, Street, Flat&hellip;), il s&rsquo;agit d&rsquo;assurer une bonne protection du pilote BMX. Ce maillot de coupe large pour y placer les protections avec un col en V tr&egrave;s l&eacute;ger et ventil&eacute; offre un confort d&#39;utilisation tout au long de la saison et se montre particuli&egrave;rement performant pour les pratiques engag&eacute;es.</p>', 'Coupe-ample-Ref-1806-A-Ref-61-61589f45bd929.png', 30, 0, 'Réf. 1806 A (Réf.61)'),
        (4, 'Body Coupe-Vent Gamex', '<p>Le Body est con&ccedil;u en mati&egrave;re &quot;Gamex&quot; de derni&egrave;re g&eacute;n&eacute;ration, ce dernier est pr&eacute;vu pour la course et les sorties estivales tout en assurant une protection contre les temps plus venteux. Avec un zip int&eacute;gral, et un tissu l&eacute;ger il est facile &agrave; mettre et &agrave; ranger. Il dispose de biais r&eacute;fl&eacute;chissants aux emmanchures pour accro&icirc;tre la visibilit&eacute; lors de vos sorties. Nous proposons, en option, 2 ouvertures avec biais r&eacute;fl&eacute;chissants dans le bas du dos sur la version filet (1807B). Cela permet un acc&egrave;s facile aux poches de votre &eacute;quipement (Maillot, Maillot manches longues,...). Ce body est &eacute;galement disponible en version Dos plein (1807C) avec un tissu &quot;Gamex&quot; comme le devant permettant d&rsquo;accro&icirc;tre votre protection contre le vent.</p>', 'Body-Coupe-Vent-Gamex-Ref-1807-B-61599b3ee0771.png', 40, 0, 'Réf. 1807 B'),
        (5, 'Veste coupe-Vent ML Gamex', '<p>Cette veste l&eacute;g&egrave;re est con&ccedil;ue pour une utilisation courante. Sa coupe vous permettra de l&rsquo;associer avec des produits plus ou moins chauds, vous pourrez ainsi affronter tout type de temps. Le Gamex &eacute;tant une mati&egrave;re coupe vent et l&eacute;g&egrave;rement d&eacute;perlante, Le Windtek pluie donnera satisfaction sous la pluie. La fluidit&eacute; de ces 2 mati&egrave;res permettra de les ranger dans la poche arri&egrave;re de votre maillot. Les bandes de c&ocirc;t&eacute; extensibles permettront d&rsquo;adapter le produit &agrave; tous les cyclistes. La veste est munie d&rsquo;un zip frontal int&eacute;gral. Sa fonction &laquo; Securit &raquo; vous permettra de bloquer la fermeture &agrave; l&rsquo;endroit souhait&eacute;. Un rabat emp&ecirc;chera la pluie et le vent de passer &agrave; la fermeture.</p>', 'Coupe-Vent-ML-Gamex-Ref-1808-A-61599bf7a4343.png', 50, 0, 'Réf. 1808 A'),
        (6, 'Manchettes', '<p>Les manchettes Lycra UV offrent une haute protection contre les rayons UV. La base de la manchette est en polyester qui aide &agrave; maintenir un excellent contr&ocirc;le de l&#39;humidit&eacute;.<br />\r\nDu silicone &agrave; double face est utilis&eacute; dans la partie sup&eacute;rieure pour assurer une adh&eacute;rence parfaite et &eacute;viter qu&#39;elles ne descendent lors des sorties.<br />\r\nElles s&rsquo;ajusteront parfaitement &agrave; votre morphologie pour un effet seconde peau.</p>', 'Manchettes-Ref-1831-A-61599d4a98b2c.png', 10, 0, 'Réf. 1831 A'),
