        (8, 'Veste Thermique Wind-Tek', '<p>Notre veste hiver PROGORA sera votre alli&eacute;e pour d&eacute;fier les conditions m&eacute;t&eacute;os les plus fra&icirc;ches. La veste est en tissu WINDTEK ZEROTEK, ce tissu technique contient une membrane coupe vent tr&egrave;s efficace et son tissu gratt&eacute; vous apportera un maximum de chaleur. La coupe est ajust&eacute;e et la grande souplesse du tissu vous permettra des mouvements confortables dans toutes les positions. Pour &eacute;viter les entr&eacute;es d&rsquo;air frais, les manches sont finies par un manchon, et le col est montant. La fermeture zipp&eacute;e type &laquo;s&eacute;curit &raquo; est munie d&rsquo;un rabat de protection ; les trois poches arri&egrave;re vous permettront d&rsquo;emmener votre ravitaillement et une quatri&egrave;me poche zipp&eacute;e gardera vos clefs et t&eacute;l&eacute;phone en lieu s&ucirc;r. Pour votre s&eacute;curit&eacute; , deux bandes r&eacute;fl&eacute;chissantes sont appos&eacute;es sur les poches arri&egrave;re pour vous assurer une bonne visibilit&eacute;. Propos&eacute;e &eacute;galement en finition poches pixels pour une visibilit&eacute; sup&eacute;rieure.</p>', 'Veste-Thermique-Wind-Tek-Ref-1810-Z-6159a0992e7e2.png', 72, 0, 'Réf. 1810 Z'),
        (9, 'Cuissard court Lycra', '<p><strong>avec bretelles et peau TRS</strong><br />\r\nLe cuissard Classic avec l&rsquo;&eacute;lastique silicon&eacute; permettant d&rsquo;&ecirc;tre solidaire avec la jambe est conseill&eacute; pour les plus jeunes cyclistes ayant un d&eacute;ficit musculaire. Fabriqu&eacute; &agrave; partir d&#39;un tissu hautement technique de fabrication italienne, sa construction multi-panneaux offre un ajustement parfait, adapt&eacute; &agrave; votre corps. Les bretelles constitu&eacute;es de tissu a&eacute;r&eacute; ultral&eacute;ger garantissent un bon maintien au corps et cela dans toutes les positions.</p>', 'Cuissard-court-Lycra-Ref-1813-B-6159a12ce396c.png', 45, 0, 'Réf. 1813 B'),
        (10, 'Collant long super Roubaix', '<p><strong>avec bretelles et peau TRS</strong><br />\r\nLe collant en Super-Roubaix offre un maintien parfait et apporte un total confort pour vos sorties hivernales. Pr&eacute;form&eacute;, sa d&eacute;coupe est con&ccedil;ue pour r&eacute;pondre aux normes attendues par les cyclistes en termes de fonctionnalit&eacute; et de style. Il est fabriqu&eacute; &agrave; partir d&#39;un tissu hautement technique de fabrication italienne, garantissant une compression et une r&eacute;tention de forme exceptionnelles. De plus la construction multi-panneaux offre un ajustement parfait, adapt&eacute; &agrave; votre corps. Les bretelles sont aussi en Super-Roubaix pour garder la chaleur dans le dos.</p>', 'Collant-long-super-Roubaix-Ref-1816-6159a18e30905.png', 55, 0, 'Réf. 1816'),
        (11, 'Corsaire en Lycra', '<p><strong>avec bretelles et peau TRS</strong><br />\r\nLe corsaire Pr&eacute;form&eacute; Mod&egrave;le interm&eacute;diaire entre le cuissard et le collant est id&eacute;al pour les sorties de la mi-saison. Il descend sous le genou mais laisse la cheville et une partie du mollet &agrave; l&#39;air libre. Fabriqu&eacute; en Lycra 210 Gr r&eacute;f 1814. Un &eacute;lastique silicon&eacute; maintient la position du corsaire au niveau du mollet.</p>', 'Collant-long-super-Roubaix-Ref-1816-6159a1f332c02.png', 50, 0, 'Réf. 1814'),
